.PortalStatusBarIndicator.PortalStatusBarIndicator.PortalStatusBarIndicator:before {
  margin-right: 0;
}
.PortalStatusBarIndicator.transmitting {
  color: #64B5F6;
}
.PortalStatusBarIndicator.transmitting:hover {
  color: #64B5F6;
}
.PortalStatusBarIndicator.outdated,
.PortalStatusBarIndicator.initialization-error {
  color: #EF5350;
}
.PortalStatusBarIndicator.outdated:hover,
.PortalStatusBarIndicator.initialization-error:hover {
  color: #EF5350;
}
.TeletypePopoverTooltip {
  user-select: none;
}
.TeletypePopoverTooltip.tooltip {
  width: 315px;
  padding-left: 10px;
  padding-right: 10px;
  box-sizing: border-box;
}
.TeletypePopoverTooltip .tooltip-inner.tooltip-inner.tooltip-inner.tooltip-inner {
  padding: 10px;
  background-color: #002b36;
  border: 1px solid transparent;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  color: rgba(131, 148, 150, 0.65);
  max-height: 300px;
  white-space: normal;
  overflow-y: auto;
}
.TeletypePopoverTooltip.top .tooltip-arrow.tooltip-arrow {
  width: 10px;
  height: 10px;
  border-width: 0 0 1px 1px;
  border-color: transparent;
  background-color: #002b36;
  border-bottom-right-radius: 2px;
  transform: rotate(-45deg);
}
.TeletypePopoverComponent {
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: -10px;
  color: rgba(131, 148, 150, 0.65) !important;
}
.PortalListComponent {
  flex: 1;
  display: flex;
  flex-direction: column;
  height: 100%;
}
.PortalListComponent--initializing {
  text-align: center;
}
.PortalParticipants {
  flex: auto;
  display: flex;
  flex-direction: row;
  align-items: center;
}
.PortalParticipants-guests {
  flex: auto;
  display: flex;
  flex-direction: row;
  align-items: center;
  align-content: start;
  flex-wrap: wrap;
}
.PortalParticipants-participant {
  margin: 5px;
}
.PortalParticipants-participant img {
  height: 22px;
  border-radius: 50%;
}
.PortalParticipants-site-1 {
  margin-left: 0;
}
.PortalParticipants-site-1 img {
  height: 28px;
}
.HostPortalComponent {
  flex: none;
}
.HostPortalComponent-status {
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0 10px;
}
.HostPortalComponent-share-toggle {
  flex: none;
}
.HostPortalComponent-share-toggle label {
  margin: 0;
  font-size: 80%;
}
.HostPortalComponent-connection-info,
.HostPortalComponent-GuestPortalsContainer {
  border-bottom: 1px solid transparent;
  padding: 0 10px;
}
.HostPortalComponent-connection-info {
  display: flex;
  flex-direction: column;
  align-items: stretch;
  padding: 10px 10px 5px;
  position: relative;
}
.HostPortalComponent-connection-info-heading.creating-portal {
  visibility: hidden;
}
.HostPortalComponent-connection-info-heading h1 {
  margin-top: 0;
  margin-bottom: 5px;
  font-weight: normal;
  font-size: 80%;
}
.HostPortalComponent-connection-info-heading h1::before {
  line-height: 1em;
  margin-right: 5px;
}
.HostPortalComponent-connection-info-portal-id {
  display: flex;
  flex-direction: row;
  margin-bottom: 5px;
}
.HostPortalComponent-connection-info-portal-id.creating-portal {
  visibility: hidden;
}
.HostPortalComponent-connection-info-portal-id .input-text {
  display: flex;
  flex: auto;
}
.HostPortalComponent-connection-info-portal-id .btn {
  margin-left: 5px;
  flex: none;
}
.HostPortalComponent-connection-info-spinner {
  position: absolute !important;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
}
.HostPortalComponent .host-id-input {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  font-size: 80%;
  color: rgba(131, 148, 150, 0.65);
}
.PortalListComponent-GuestPortalsContainer {
  flex: 1;
}
.GuestPortalComponent {
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0 10px;
}
.GuestPortalComponent-leave.btn {
  flex: none;
  width: 50px;
}
.GuestPortalComponent-leave.btn label {
  margin: 0;
  font-size: 80%;
}
.SignInComponent {
  text-align: center;
  padding: 10px;
}
.SignInComponent atom-text-editor {
  font-size: 12px !important;
  margin-bottom: 10px;
  text-align: left;
}
.SignInComponent-GitHubLogo::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 40px;
  width: 40px;
  height: 40px;
  content: "\f00a";
}
.JoinPortalComponent--no-prompt,
.JoinPortalComponent--prompt {
  border-top: 1px solid transparent;
}
.JoinPortalComponent--no-prompt {
  flex: none;
  height: 40px;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
}
.JoinPortalComponent--no-prompt label {
  color: rgba(131, 148, 150, 0.35);
  font-size: 12px;
  margin: 0;
}
.JoinPortalComponent--no-prompt label:hover {
  color: rgba(255, 255, 255, 0.8);
  cursor: pointer;
}
.JoinPortalComponent--prompt {
  flex: none;
  height: 40px;
  text-align: left;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  padding: 0 10px;
}
.JoinPortalComponent--prompt atom-text-editor {
  flex: auto;
  font-size: 80% !important;
}
.JoinPortalComponent--prompt .btn {
  flex: none;
  width: 50px;
  margin-left: 5px;
}
.cursors.blink-off .cursor.non-blinking {
  opacity: 1;
}
.cursor.ParticipantCursor--site-1 {
  border-left-color: #8BC34A;
}
.cursor.ParticipantCursor--site-2 {
